import React from 'react'

import './kontingen.css'
import { Department } from '../../components'
import { g1, g2, g3, g4, g5, g6, g7, g8 } from '../../components/department/imports'

const departmentData = [
  {
    departmentImage: g1,
    departmentName: 'G1 '
  },
  {
    departmentImage: g2,
    departmentName: 'G2'
  },
  {
    departmentImage: g3,
    departmentName: 'G3'
  },
  {
    departmentImage: g4,
    departmentName: 'G4'
  },
  {
    departmentImage: g5,
    departmentName: 'G5'
  },
  {
    departmentImage: g6,
    departmentName: 'G6'
  },
  {
    departmentImage: g7,
    departmentName: 'G7'
  },
  {
    departmentImage: g8,
    departmentName: 'G8'
  },
]

const Kontingen = () => {
  return (
    <div className='spirit__kontingen section__padding' id='kontingen'>
      <div className='spirit__kontingen-heading'>
        <h1>KONTINGEN</h1>
      </div>
      <div className='spirit__kontingen-container'>
        {departmentData.map((item, index) => (
          <Department departmentImage={item.departmentImage} departmentName={item.departmentName} key={item.departmentImage + index} />
        ))}
      </div>
    </div>
  )
}

export default Kontingen
